package basic_007_String_bufferString_Handling;

/**
 * @author lenovo
 *
 */
public class A006_continue {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=0; i<=10; i++) {
			if(i==5) {
				continue;
			}
			System.out.println(i);
		}

	}

}
